import { Fragment } from "react";
import { Routes, Route } from "react-router-dom";
import "./App.css";
import Student from "./components/student/Student";

function App() {
  return (
    <Fragment>
      <Routes>
        <Route path="/" element={<Student />} />
      </Routes>
    </Fragment>
  );
}

export default App;
